/// Take ownership of the value.
///
/// # Examples
///
/// ```
/// use hashbrown::hash_set::{Entry, HashSet};
///
/// let mut set: HashSet<&str> = HashSet::new();
///
/// match set.entry("poneyland") {
///     Entry::Occupied(_) => panic!(),
///     Entry::Vacant(v) => assert_eq!(v.into_value(), "poneyland"),
/// }
/// ```
